  `ACTIVITY_STATUS` tinyint(4) DEFAULT NULL COMMENT '0、未发布；1、已发布；2、已售罄；3、活动中止；4、已删除',
  `ACTIVITY_TYPE` tinyint(4) DEFAULT NULL COMMENT '1、平台；2、店铺',
