  `PLATFORM_ID` tinyint(4) DEFAULT NULL COMMENT '0、科印平台；2、绿印平台',
  `INSERT_TIME` datetime DEFAULT NULL COMMENT '插入时间',
  `INSERT_BY` bigint(20) DEFAULT NULL COMMENT '插入人',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '更新时间',
  `UPDATE_BY` bigint(20) DEFAULT NULL COMMENT '更新人',
  PRIMARY KEY (`CENTRAL_PURCHASING_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=303 DEFAULT CHARSET=utf8 COMMENT='集采活动表';

