/*Table structure for table `central_purchasing_activites_details` */

DROP TABLE IF EXISTS `central_purchasing_activites_details`;

CREATE TABLE `central_purchasing_activites_details` (
  `ACTIVITES_DETAILS_ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `CENTRAL_PURCHASING_ID` bigint(20) DEFAULT NULL COMMENT '集采活动ID',
  `ITEM_ID` bigint(20) DEFAULT NULL COMMENT '商品id',
  `SKU_ID` bigint(21) DEFAULT NULL COMMENT 'skuID',
  `CID` bigint(20) DEFAULT NULL COMMENT '类目ID',
  `ESTIMATE_PRICE` varchar(50) DEFAULT NULL COMMENT '集采预估价',
  `CENTRAL_PURCHASING_PRICE` decimal(14,2) DEFAULT NULL COMMENT '集采价',
  `ORIGINAL_PRICE` decimal(14,2) DEFAULT NULL COMMENT '原价',
  `SIGN_UP_NUM` bigint(20) DEFAULT NULL COMMENT '已报名人数',
  `PLACE_ORDER_NUM` bigint(20) DEFAULT NULL COMMENT '已下单人数',
  `PAID_NUM` bigint(20) DEFAULT NULL COMMENT '已付款人数',
  `PER_PERCHASE_MAX_NUM` bigint(20) DEFAULT NULL COMMENT '每个用户可购买的最大数量',
  `RELEASE_GOODS_MAX_NUM` bigint(20) DEFAULT NULL COMMENT '发布团购的最大数量',
  `INSERT_TIME` datetime DEFAULT NULL COMMENT '插入时间',
  `INSERT_BY` bigint(20) DEFAULT NULL COMMENT '插入人',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '更新时间',
  `UPDATE_BY` bigint(20) DEFAULT NULL COMMENT '更新人',
  PRIMARY KEY (`ACTIVITES_DETAILS_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=303 DEFAULT CHARSET=utf8 COMMENT='集采详情表';

