/*Table structure for table `central_purchasing_enterprise` */

DROP TABLE IF EXISTS `central_purchasing_enterprise`;

CREATE TABLE `central_purchasing_enterprise` (
  `ENTERPRISE_ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `ENTERPRISE_NAME` varchar(100) DEFAULT NULL COMMENT '采购单位',
  `ENTERPRISE_LINKMAN` varchar(50) DEFAULT NULL COMMENT '联系人',
  `PHONE_NO` varchar(16) DEFAULT NULL COMMENT '手机号码',
  `EMAIL` varchar(255) DEFAULT NULL COMMENT '邮箱',
  `ADDRESS` varchar(512) DEFAULT NULL COMMENT '联系地址',
  `QQ_WX` varchar(50) DEFAULT NULL COMMENT 'QQ/微信',
  `BUSINESS_TYPE` varchar(512) DEFAULT NULL COMMENT '业务类型',
  `INSERT_TIME` datetime DEFAULT NULL COMMENT '插入时间',
  `INSERT_BY` bigint(20) DEFAULT NULL COMMENT '插入人',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '更新时间',
  `UPDATE_BY` bigint(20) DEFAULT NULL COMMENT '更新人',
  PRIMARY KEY (`ENTERPRISE_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=124 DEFAULT CHARSET=utf8 COMMENT='参与集采单位信息表';

