/*Table structure for table `central_purchasing_ref_order` */

DROP TABLE IF EXISTS `central_purchasing_ref_order`;

CREATE TABLE `central_purchasing_ref_order` (
  `ORDER_ACTIVITIES_DETAIL_ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `ACTIVITES_DETAILS_ID` bigint(20) DEFAULT NULL COMMENT '集采详情ID',
