  `ITEM_ID` bigint(20) DEFAULT NULL COMMENT '商品ID',
  `SKU_ID` bigint(21) DEFAULT NULL COMMENT 'skuID',
  `PURCHASE_NUM` bigint(20) DEFAULT NULL COMMENT '购买数量',
