/*Table structure for table `coupon_info` */

DROP TABLE IF EXISTS `coupon_info`;

CREATE TABLE `coupon_info` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `COUPON_ID` varchar(20) DEFAULT NULL COMMENT '优惠券编号',
  `COUPON_NAME` varchar(100) DEFAULT NULL COMMENT '优惠券名称',
  `COUPON_TYPE` int(2) DEFAULT NULL COMMENT '优惠券类型(1:满减券,2:折扣券,3:现金券)',
  `MEET_PRICE` decimal(14,2) DEFAULT NULL COMMENT '优惠券使用需要满足条件',
  `SHOP_ID` bigint(20) DEFAULT NULL COMMENT '店铺id',
  `COUPON_USING_RANGE` int(2) DEFAULT NULL COMMENT '优惠券使用范围(1:平台通用类,2:店铺通用类,3:品类通用类,4:SKU使用类)',
  `PLATFORM_ID` int(2) DEFAULT NULL COMMENT '优惠券使用平台(1:pc端,2:绿印平台,3:移动端4:pc端和移动端)',
  `COUPON_USER_TYPE` int(2) DEFAULT NULL COMMENT '优惠券使用用户类型',
  `COUPON_USER_MEMBERSHIP_LEVEL` varchar(255) DEFAULT NULL COMMENT '优惠券适用会员等级（1:普通、2:铜牌、3:银牌、4:金牌、5:钻石）',
  `COUPON_AMOUNT` decimal(14,2) DEFAULT NULL COMMENT '优惠券面额',
  `ALLOW_GET_NUM` int(9) DEFAULT NULL COMMENT '每个人优惠券可以领取的数量',
  `COUPON_NUM` int(9) DEFAULT NULL COMMENT '优惠券数量',
  `COUPON_MAX` decimal(14,2) DEFAULT NULL COMMENT '优惠最高金额',
  `SEND_COUPON_TYPE` int(2) DEFAULT NULL COMMENT '优惠券发放方式',
  `STATE` int(2) DEFAULT NULL COMMENT '优惠券状态 0-未开始 1-已开始 2-已结束 3-已中止 4-待送审 5-待审核 6- 审核驳回 7-已领完',
  `COUPON_START_DATE` datetime DEFAULT NULL COMMENT '优惠券使用开始时间',
  `COUPON_END_DATE` datetime DEFAULT NULL COMMENT '优惠券使用结束时间',
  `UPDATE_DATE` datetime DEFAULT NULL COMMENT '修改时间',
  `VERIFY_USER` bigint(20) DEFAULT NULL COMMENT '审核人',
  `CREATE_USER` varchar(50) DEFAULT NULL COMMENT '创建人',
  `DELETED` int(2) DEFAULT NULL COMMENT '是否删除',
  `REJECT_REASON` varchar(300) DEFAULT NULL COMMENT '送审驳回原因',
  `COUPONEXPLAIN` varchar(200) DEFAULT NULL COMMENT '优惠券说明',
  `COST_ALLOCATION` int(2) DEFAULT NULL COMMENT '成本分摊  1：平台分摊  2： 店铺分摊',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=554 DEFAULT CHARSET=utf8 COMMENT='优惠券适用会员等级（1:普通、2:铜牌、3:银牌、4:金牌、5:钻石）';

