/*Table structure for table `coupon_user` */

DROP TABLE IF EXISTS `coupon_user`;

CREATE TABLE `coupon_user` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `COUPON_ID` varchar(20) DEFAULT NULL COMMENT '优惠券编号',
  `USER_ID` bigint(20) DEFAULT NULL COMMENT '此优惠券领取者ID',
  `USER_COUPON_TYPE` int(2) DEFAULT NULL COMMENT '用户领取优惠券的状态',
  `COUPON_RECEIVE_TIME` date DEFAULT NULL COMMENT '优惠券领取时间',
  `DELETED` int(1) DEFAULT NULL COMMENT '是否删除    0-未删除，   1-删除',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=838 DEFAULT CHARSET=utf8;

