/*Table structure for table `integral_config` */

DROP TABLE IF EXISTS `integral_config`;

CREATE TABLE `integral_config` (
  `CONFIG_ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `INTEGRAL_TYPE` tinyint(4) DEFAULT NULL COMMENT '1、金额返还积分；2、评价获取积分；3、订单使用积分；4、积分兑换金额 7、评价+晒单获取积分',
  `START_PRICE` decimal(14,2) DEFAULT NULL COMMENT '起价',
  `END_PRICE` decimal(14,2) DEFAULT NULL COMMENT '止价',
  `GET_INTEGRAL` decimal(14,4) DEFAULT NULL COMMENT '获得积分数',
  `USE_INTEGRAL` bigint(10) DEFAULT NULL COMMENT '使用积分数',
  `EXCHANGE_RATE` decimal(14,2) DEFAULT NULL COMMENT '一个积分兑换的钱数',
  `STATE` tinyint(4) DEFAULT NULL COMMENT '状态',
  `INSERT_TIME` date DEFAULT NULL COMMENT '插入时间',
  `INSERT_BY` bigint(20) DEFAULT NULL COMMENT '插入人',
  `UPDATE_TIME` date DEFAULT NULL COMMENT '更新时间',
  `UPDATE_BY` bigint(20) DEFAULT NULL COMMENT '更新人',
  `PLATFORM_ID` tinyint(10) DEFAULT NULL COMMENT '平台类型',
  PRIMARY KEY (`CONFIG_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=371 DEFAULT CHARSET=utf8 COMMENT='积分配置';

