/*Table structure for table `promotion_info` */

DROP TABLE IF EXISTS `promotion_info`;

CREATE TABLE `promotion_info` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `seller_id` bigint(20) DEFAULT NULL COMMENT '商家ID',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺ID',
  `activity_name` varchar(512) DEFAULT NULL COMMENT '活动名称',
  `type` tinyint(2) DEFAULT NULL COMMENT '促销类型，1：直降，2：满减',
  `start_time` datetime DEFAULT NULL COMMENT '促销开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '促销结束时间',
  `online_state` tinyint(2) DEFAULT NULL COMMENT '促销在线状态，1：已上线，2：已下线,3：中止，4：待送审，5：待审核，6：审核驳回',
  `words` varchar(512) DEFAULT NULL COMMENT '广告语',
  `create_user` varchar(255) DEFAULT NULL COMMENT '创建人',
  `reviewer` varchar(255) DEFAULT NULL COMMENT '审核人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT ' 更新时间',
  `user_type` int(2) DEFAULT NULL COMMENT '用户类型(0：全部用户，1：个人用户，2：企业用户)',
  `is_all_item` int(1) DEFAULT NULL COMMENT '活动范围（1：所有商品；2：部分商品）',
  `membership_level` varchar(255) DEFAULT NULL COMMENT '会员等级,多个会员则用，隔开',
  `platform_id` int(1) DEFAULT NULL COMMENT '平台ID（2：绿印）',
  `deleted` int(1) DEFAULT NULL COMMENT '是否删除（1：已删除；0未删除）',
  `auditDismissedMsg` varchar(500) DEFAULT NULL COMMENT '用户成长值',
  PRIMARY KEY (`id`)
