/*Table structure for table `promotion_markdown` */

DROP TABLE IF EXISTS `promotion_markdown`;

CREATE TABLE `promotion_markdown` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `promotion_info_id` bigint(20) DEFAULT NULL COMMENT '促销id',
  `sku_id` bigint(20) DEFAULT NULL COMMENT 'skuID',
  `item_id` bigint(20) DEFAULT NULL COMMENT '商品ID',
  `area_id` varchar(255) DEFAULT '0' COMMENT '地域 ID',
  `min_num` bigint(20) DEFAULT NULL COMMENT '最少订货量',
  `max_num` bigint(20) DEFAULT NULL COMMENT '最大订货量',
  `sell_price` decimal(14,2) DEFAULT NULL COMMENT '销售价',
  `promotion_price` decimal(14,2) DEFAULT NULL COMMENT '直降优惠价',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `discount_percent` decimal(14,3) DEFAULT NULL COMMENT '折扣百分比',
  `markdown_type` tinyint(1) DEFAULT NULL COMMENT '优惠计算方式 1：折扣，2：直降优惠价',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=768 DEFAULT CHARSET=utf8 COMMENT='促销直降表';

