/*Table structure for table `temp_vip_card` */

DROP TABLE IF EXISTS `temp_vip_card`;

CREATE TABLE `temp_vip_card` (
  `id` bigint(10) NOT NULL AUTO_INCREMENT,
  `vip_id` int(8) DEFAULT NULL COMMENT 'VIP卡号',
  `buyer_id` bigint(21) DEFAULT NULL COMMENT '买家id',
  `discount_type` varchar(50) DEFAULT NULL COMMENT '折扣类型',
  `discount_percent` int(11) DEFAULT NULL COMMENT '折扣率',
  `start_date` datetime DEFAULT NULL COMMENT '起始日期',
  `end_data` datetime DEFAULT NULL COMMENT '结束日期',
  `create_time` datetime DEFAULT NULL COMMENT 'VIP卡创建时间',
  `residual_amount` decimal(14,2) DEFAULT NULL COMMENT 'VIP卡余额',
  `status` int(1) DEFAULT NULL COMMENT '1-有效，2-无效，3-未启用',
  `memo` varchar(1000) DEFAULT NULL COMMENT '备注',
  `obligate1` varchar(50) DEFAULT NULL COMMENT '预留字段1',
  `obligate2` varchar(50) DEFAULT NULL COMMENT '预留字段2',
  `obligate3` varchar(50) DEFAULT NULL COMMENT '预留字段3',
  `ignore_type` varchar(100) DEFAULT NULL COMMENT '不能应用vip折扣卡的商品一级分类，多个以,隔开',
  PRIMARY KEY (`id`)
